import React, { useState } from 'react';

import { Conteudo } from './style';
import { Table, Button, Space } from 'antd';


export default function TabelaHistorico(){

    const data = [
        {
            nome: 'Rogerio',
            ra: '18123466',
            orientador: 'milton',
            orientadorI: 1,
            orientadorAR:  1,
            orientadorA:  3,
            CPPI: 1,
            CPPAR: 1,
            CPPA: 3,
        }
    ]

    const columns = [
        {
          title: 'Nome',
          dataIndex: 'nome',
          key: 'nome',
        },
        {
          title: 'RA',
          dataIndex: 'ra',
          key: 'ra',
        },
        {
          title: 'Orientador',
          dataIndex: 'orientador',
          key: 'orientador',
        },
        {
          title: 'Pareceres Orientador',
          dataIndex: 'parecerOrientador',
          key: 'parecerOrientador',
          children: [
            {
              title: 'Nº I',
              dataIndex: 'orientadorI',
              key: 'orientadorI'
            },
            {
              title: 'Nº AR',
              dataIndex: 'orientadorAR',
              key: 'orientadorAR'
            },
            {
              title: 'Nº A',
              dataIndex: 'orientadorA',
              key: 'orientadorA'
            }
          ]
        },
        {
            title: 'Pareceres CPP',
            dataIndex: 'parecerCPP',
            key: 'parecerCPP',
            children: [
              {
                title: 'Nº I',
                dataIndex: 'CPPI',
                key: 'CPPI'
              },
              {
                title: 'Nº AR',
                dataIndex: 'CPPAR',
                key: 'CPPAR'
              },
              {
                title: 'Nº A',
                dataIndex: 'CPPA',
                key: 'CPPA'
              }
            ]
          },
          {
            title: 'action',
            key: 'action',
            render: (text, record) => (
              <Space size="middle">
                <Button>Desligar</Button>
                <Button>Ver mais</Button>
              </Space>
            ),
          },
      ];

    return(
        <Conteudo>
            <Table
            columns={columns}
            dataSource={data}
            bordered
            size="middle"
            />
        </Conteudo>
    );
}
